import React from "react";

export const Form = ({ userInput, onFormChange }) => {
  const handleChange = (event) => {
    onFormChange(event.target.value);
  };

  return (
    <>
      <form>
        <input
          type="text"
          required
          value={userInput}
          onchange={handleChange}
        ></input>
        <input type="submit"></input>
      </form>
    </>
  );
};
